nodeLinker: pnp

packageExtensions:
  '@toast-ui/react-editor@^2.5.4':
    dependencies:
      react: ^17.0.2
  '@types/redux-devtools-extension@^2.13.2':
    dependencies:
      redux: ^4.2.1
  antd-style@^3.6.1:
    dependencies:
      react: ^17.0.2
      react-dom: ^17.0.2
  '@tanstack/router-vite-plugin@^1.25.0':
    dependencies:
      vite: ^5.2.7

supportedArchitectures:
  cpu:
    - ia32
    - x86
    - x64
    - arm64
  libc:
    - glibc
    - musl
  os:
    - darwin
    - linux

yarnPath: .yarn/releases/yarn-3.7.0.cjs
